import React from "react";

const PostList = () => {
  return (
    <React.Fragment>
      <tr>
        <th scope="col">글번호</th>
        <th scope="col">글쓴이</th>
        <th scope="col">글제목</th>
      </tr>
    </React.Fragment>
  );
};

export default PostList;
